import React from "react";
import { useEffect, useState } from "react";
import axios from "axios";
import "./Component.scss";

const Component = () => {
  const [data, setData] = useState([]);
  useEffect(() => {
    try {
      (async function () {
        let res = await axios.get(
          "https://run.mocky.io/v3/d03e0886-f5c8-4961-902d-51bfe8059a33"
        );
        let data = res.data ? res.data : [];
        setData(data);
        console.log("data:", data);
      })();
    } catch (error) {
      console.log(error);
    }
  });
  return (
    <div className="container">
      <div className="body">
        <div className="body-left">Image</div>
        <div className="body-right">
          <div className="title">title</div>
          <div className="information">information</div>
        </div>
      </div>
      <div className="footer">
        <div className="footer-select">
          <select>
            <option value="one">One</option>
            <option value="tow">Tow</option>
            <option value="three">Three</option>
          </select>
        </div>
        <div className="prev">Prev</div>
        <div className="footer-list">
          <div className="list">
            <div className="item">list1</div>
            <div className="item">list2</div>
            <div className="item">list3</div>
            <div className="item">list4</div>
            <div className="item">list5</div>
            <div className="item">list6</div>
            <div className="item">list6</div>
            <div className="item">list6</div>

            <div className="item">list6</div>
          </div>
        </div>
        <div className="next">Next</div>
      </div>
    </div>
  );
};

export default Component;
